import React from 'react';
import "./Button.css";
const buttonStyle = {
  margin: '10px 0',
  padding: '2'
  
};

const Button = ({ label, handleClick }) => (
  <button
    className="btn btn-default"
    style={buttonStyle}
    onClick={handleClick}
  >
    {label}
    Mark Your Attendence
  </button>
);

export default Button;
